	@override
	Widget build(BuildContext context) {
		return Column(
				children: [
					Container(
						width: double.infinity,
						height: 215,
						decoration: BoxDecoration(
							gradient: LinearGradient(
								colors: [
									accent,
									Theme.of(context).scaffoldBackgroundColor,
								],
								begin: const FractionalOffset(0.0, 0.0),
								end: const FractionalOffset(0.0, 1.0),
								stops: [0.0, 1.0],
								tileMode: TileMode.clamp,
							),
						),
						child: Padding(
							padding: EdgeInsets.all(15),
							child: Column(
								children: [
									Expanded(
										child: Row(
											children: [
												Expanded(
													child: Padding(
														padding: EdgeInsets.symmetric(vertical: 15),
														child: Column(
															crossAxisAlignment: CrossAxisAlignment.start,
															children: [
																Text(
																	'Selamat Datang',
																	style: TextStyle(
																		color: primary,
																		fontWeight: FontWeight.bold,
																		fontSize: 18,
																	),
																),
																Text('Di Perpustakaan Digital SMA Intensif Taruna Pembangunan Surabaya', style: TextStyle(color: primary)),
															],
														),
													),
												),
												SizedBox(width: 15),
												AspectRatio(
													aspectRatio: 1,
													child: Image.asset("assets/images/searchUI.png", fit: BoxFit.fitWidth),
												),
											],
										),
									),
									InputChanged(
										hintText: "Ketikkan judul buku...",
										icon: Icons.search, color: Colors.white,
										changed: (value) {
											setState((){
												buku = data.where((element) => element['title'].toLowerCase().contains(value.toString())).toList();
											});
										},
									),
								],
							),
						),
					),
					Container(
						width: double.infinity,
						padding: const EdgeInsets.fromLTRB(15, 5, 15, 15),
						child: Text(
							'Buku yang bisa kamu baca',
							style: TextStyle(
								fontWeight: FontWeight.bold,
								fontSize: 16,
							),
						),
					),
					Expanded(
						child: Padding(
							padding: const EdgeInsets.symmetric(horizontal: 15),
							child: GridView.builder(
								gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
									crossAxisCount: 3,
									crossAxisSpacing: 15,
									mainAxisSpacing: 15,
									childAspectRatio: 0.5,
								),
								itemCount: buku.length,
								itemBuilder: (BuildContext ctx, index) {
									return InkWell(
										onTap: () {
											Navigator.push(
												context,
												new MaterialPageRoute(
													builder: (BuildContext context) => new Pdf(buku[index]['title'], buku[index]['pdfUrl'], buku[index]['imageUrl']),
												),
											);
										},
										child: Container(
											child: Column(
												children: [
													ClipRRect(
														borderRadius: BorderRadius.circular(20),
														child: Image.network(buku[index]['imageUrl'], height: 150),
													),
													SizedBox(height: 15),
													Text(buku[index]['title'],
														style: TextStyle(fontWeight: FontWeight.w600, fontSize: 12),
														textAlign: TextAlign.center,
														maxLines: 3,
														overflow: TextOverflow.ellipsis,
													),
												],
											),
										),
									);
								},
							),
						),
					),
				]
		);
	}
